import React,{useState,useEffect} from 'react'
import Form from "react-bootstrap/Form";

export default function Saledetail() {
    const [list,setList] = useState([]);
    return (
        <div className="container">
        <h3 >SALE REPORT</h3>
        {/* {cost.map((elt)=>{return (<p>Total Cost:{elt.total} BAHT</p>)})} */}
        <div>
      <tr className="btn mt-1">
      <td>
          {/* <Form.Control
          class="form-control mr-sm-2"
          type="search"
          placeholder="Search"
          onChange={(e) =>{
            setID(e.target.value)
          }}
          /> */}
          {/* {buy_list.map((item) => {
            return <p>{item.buy_id}</p>
          })} */}
        </td>
        <td>
          <a href="/insertbuy">
            <button className="btn btn-success ml-3">เพิ่มข้อมูล</button>
          </a>
        </td>
      </tr>
      </div>
      <table className="table table-striped">
        <thead>
          <tr>
            <th>Sale id</th>
            <th>Item</th>
            <th>Full Product ID</th>
            <th>Sale Amount</th>
            <th>Sale Cost</th>
            <th>Sale Price</th>
          </tr>
        </thead>
        <tbody>
          {list.map((elt) => {
            return (
              <tr>
                <td>{elt.sale_id}</td>
                <td>{elt.item}</td>
                <td>{elt.full_prod_id}</td>
                <td>{elt.sale}</td>
                <td>{elt.receiver_phone}</td>
                <td>{elt.sale_status}</td>
                <td>{elt.delivery_id}</td>
                <td>{elt.delivery_price}</td>
                <td>{elt.delivery_begin_date}</td>
                <td>{elt.delivery_receive_date}</td>
                <td>{elt.address}</td>
                <td>{elt.delivery_status}</td>
                {/* <td>
                  <EditBuy
                    buy_date={elt.buy_date}
                    buy_id={elt.buy_id}
                    buy_status={elt.buy_status}
                  />
                </td> */}
                <td>
                  {/* <button
                    className="btn btn-danger"
                    onClick={() => deleteItem(elt.sale_id)}
                  >Del</button> */}
                </td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
    )
}
